import React from "react";
import { Grid, Text, Button, Input, Image } from "../elements";

const Header = (props) => {
  return (
    <React.Fragment>
      <Grid is_flex>
        <Image
          shape="rectangle"
          src="https://d1unjqcospf8gs.cloudfront.net/assets/home/base/header/logo-basic-24b18257ac4ef693c02233bf21e9cb7ecbf43ebd8d5b40c24d99e14094a44c81.svg"
        >
          당근마켓
        </Image>
        <Input>인풋박스</Input>
        <Button>버튼1</Button>
        <Button>버튼2</Button>
      </Grid>
    </React.Fragment>
  );
};

Header.defaultProps = {};

export default Header;
